I am so happy and proud of how our second location @bossbeautysuite2 turned out. All those long hours, sleepless nights, self doubts, tears, and being overwhelmed paid off. 

Thank you for everyone that came to the sip and tour and leased a suite, Welcome to the boss beauty family. To all my friends,family and my man that came to support thank you so much for all the love and support y’all poured in to me. 

 @squareonehomedesigns thank you for working overtime all those late nights to get everything done. There is nothing he can’t do. 
@curedcraftco omg thank you for the beautiful charcuterie table definitely will be booking you again. 

I will be taking tours all next week for both locations Buford and Decatur . Limited suites available i have 3 suites in Buford and 3 in Decatur. Don’t forget ask about our holiday special $100 off. If you interested any of our locations give us a call 404-996-9278 or dm us @bossbeautysuite2 @bossbeauty_salonss

